import React from 'react';
import './services.css';
import offer1 from '../assets/images/offer1.jpeg'
import offer2 from '../assets/images/offer2.webp'
import offer3 from '../assets/images/offer3.avif'

const ServicesCard = () => {

    return (
        <div className="service_item">
            <div className="service_img">
                <img src={offer1} alt='' />
            </div>
            <div className="service_content">
                <h5 className="service_title"></h5>
                <p className="service_desc"></p>
            </div>
        </div>
        
    );
};

export default ServicesCard;
